  selector: 'app-productregister',
  templateUrl: './productregister.component.html',
  styleUrls: ['./productregister.component.scss']
})
export class ProductregisterComponent {

  constructor(private fb:FormBuilder,private backendservice:BackEndServiceService) {}

  ProductRegisterForm=this.

  OnSubmit(){
    this.backendservice.insertproductdata
  }

}
